import { createApp } from 'vue';
import App from './App.vue';
import router from './router';
import BootstrapNext from 'bootstrap-vue-next';
import { store } from './src/store';

const app = createApp(App);
app.use(router);
app.use(store);
app.use(BootstrapNext);
app.mount('#app');
